Secondo la circolare n. 25 dell'Inps del 11.2.2022, gli aliquote, il valore minimale e il valore massimale del reddito erogato per il calcolo dei contributi dovuti da tutti i soggetti iscritti alla Gestione separata di cui all'articolo 2, comma 26, della legge 335 del 1995, sono i seguenti:

*   Aliquote: 0,9% del reddito imponibile;
*   Minimo: 0,9% del reddito imponibile;
*   Massimo: 1,9% del reddito imponibile.

A sociedade beneficiária foi classificada como micro, pequena ou média empresa, de acordo com os critérios previstos no anexo ao Decreto-Lei n.º 372/2007, de 6 de novembro, alterado pelo Decreto-Lei n.º 143/2009, de 16 de junho, conforme o seguinte:

- Microempresas são empresas que atendem a um dos seguintes critérios:
  - Atividade principal ou principal atividade comercial;
  - Atividade secundária ou secundária;
  - Atividade de serviços;
  - Atividade industrial;
  - Atividade agrícola;
  - Atividade de construção civil;
  - Atividade de transporte;
  - Atividade de serviços financeiros;
  - Atividade de serviços de informática;
  - Atividade de serviços de comunicação;
  - Atividade de serviços de turismo;
  - Atividade de serviços de entretenimento;
